import React from 'react'
import PropTypes from 'prop-types';

function Food({name, picture, rating}) {
  return (
    <div>
      <h2> I Like {name}</h2>
      <h4>{rating}/5.0</h4>
      <img src={picture} alt={name}/>
    </div>
  );
}

const foodiLike = [
  {
      id : 1,
      name : 'Kimchi',
      image : 'https://search.pstatic.net/common/?src=http%3A%2F%2Fshop1.phinf.naver.net%2F20210601_167%2F1622536005580Tq1xD_JPEG%2F23671901270775631_754407834.jpg&type=a340',
      rating: 5,
  },
  {
    id : 2,
    name : 'Samgyeopsal',
    image : 'https://search.pstatic.net/common/?src=http%3A%2F%2Fblogfiles.naver.net%2FMjAyMjEyMTJfMjQx%2FMDAxNjcwODAxMTQwODU5.uId4Sawe1DjGBkLYph4VnWtjZQ6h0baOkhqQzectKrMg.i8xwGAZ1nTyDM2vufGkynGcNpdB6FOBmIaF5yRNDDIog.JPEG.sohot94%2FIMG_2382.jpg&type=a340',
    rating : 4.9,
  },
  {
    id : 3,
    name: 'Bibimbap',
    image:'https://search.pstatic.net/common/?src=http%3A%2F%2Fblogfiles.naver.net%2FMjAyMjExMjlfOTkg%2FMDAxNjY5Njg5NTI2NzU3.q4PUvhI0C42Yfi8js-tvA7sXcus-s-S_XAWY9yaBJiEg.pry1FzM7qja8XHN8FWYQxI8I1e7RZkIBDZ68GfJd4aQg.JPEG.violetnotes%2FKakaoTalk_20221128_205604206_20.jpg&type=a340',
    rating : 3.4,
  },
  {
    id : 4,
    name: 'Doncasu',
    image: 'https://search.pstatic.net/common/?src=http%3A%2F%2Fblogfiles.naver.net%2FMjAyMjEyMDVfMjEy%2FMDAxNjcwMjE5OTc2NzE0.3ufs-8ircbx_eiNHhfkheA0xlI9oZczOzxY_imr416cg.oKF8Uv4z7rcJQlgRNzb9z_IMR3sgVaWRBlbAIgu75WIg.JPEG.pja2194%2FIMG_8701.jpg&type=a340',
    rating : 2.5,
  },
  {
    id : 5,
    name : 'Kimbap',
    image : 'https://search.pstatic.net/common/?src=http%3A%2F%2Fblogfiles.naver.net%2FMjAyMjEyMDdfMjQ1%2FMDAxNjcwNDIxMTE1MTQ0.FENqWk2ZasFVCTcB92x33Mc4EpdaGYtZCBiIpSDDEN0g.4JePigglonqcPNXLpRIEgLQE6NThdAIPjwEnNsuiUCIg.JPEG.simplepalace%2Foutput_2092019583.jpg&type=a340',
    rating : 4.4
  },
];

function App() {
  return (
    <div>
      {foodiLike.map(dish=>(
        <Food key={dish.id} name={dish.name} picture={dish.image} rating={dish.rating}/>
      ))}
    </div>
  );
}

export default App;
